import React, { useState } from 'react';
import { Upload } from 'lucide-react';
import { classifyImage } from '../utils/api';

const ClassificationPage = () => {
  const [selectedImage, setSelectedImage] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [selectedModel, setSelectedModel] = useState('mobilenet_v3');

  const models = [
    { value: 'mobilenet_v3', label: 'MobileNet V3' },
    { value: 'efficientnet_b0', label: 'EfficientNet B0' },
    { value: 'resnet18', label: 'ResNet 18' },
    { value: 'resnet50', label: 'ResNet 50' },
    { value: 'squeezenet1_1', label: 'SqueezeNet' },
    { value: 'mobilevit', label: 'MobileViT' },
  ];

  const handleImageUpload = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    setSelectedImage(URL.createObjectURL(file));
    setIsLoading(true);

    try {
      const result = await classifyImage(file, selectedModel);
      setPrediction(result);
    } catch (error) {
      console.error('Error:', error);
      alert(`Error processing image: ${error.message}`);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div
      className="bg-cover bg-center min-h-screen"
      style={{ backgroundImage: "url('https://static.vecteezy.com/system/resources/thumbnails/047/895/685/small_2x/miniature-earth-sphere-on-a-misty-surface-photo.jpg')" }}
    >
      <div className="max-w-4xl mx-auto p-6">
        <h1 className="text-3xl font-bold mb-8">OCT Image Classification</h1>

        {/* Model Selection */}
        <div className="mb-6">
          <label className="block text-gray-700 font-bold mb-2">Select Model</label>
          <select
            value={selectedModel}
            onChange={(e) => setSelectedModel(e.target.value)}
            className="w-full p-2 border rounded-lg"
          >
            {models.map((model) => (
              <option key={model.value} value={model.value}>
                {model.label}
              </option>
            ))}
          </select>
        </div>

        {/* Image Upload */}
        <div className="mb-6">
          <label className="block text-gray-700 font-bold mb-2">Upload OCT Image</label>
          <div className="border-2 border-dashed border-gray-300 rounded-lg p-8 text-center">
            <input
              type="file"
              accept="image/*"
              onChange={handleImageUpload}
              className="hidden"
              id="image-upload"
            />
            <label htmlFor="image-upload" className="cursor-pointer">
              <Upload className="mx-auto h-12 w-12 text-gray-400" />
              <p className="mt-2 text-sm text-gray-600">Click or drag image to upload</p>
            </label>
          </div>
        </div>

        {/* Results */}
        {isLoading && (
          <div className="text-center py-4">
            <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-600 mx-auto"></div>
            <p className="mt-2">Processing...</p>
          </div>
        )}

        {selectedImage && !isLoading && (
          <div className="grid md:grid-cols-2 gap-6">
            <div>
              <h3 className="font-bold mb-2">Original Image</h3>
              <img
                src={selectedImage}
                alt="Uploaded OCT"
                className="rounded-lg shadow-md"
              />
            </div>
            {prediction && (
              <div className="bg-white p-6 rounded-lg shadow-md">
                <h3 className="font-bold mb-4">Results</h3>
                <div className="space-y-2">
                  <p>
                    <span className="font-semibold">Condition:</span>{' '}
                    {prediction.class}
                  </p>
                  <p>
                    <span className="font-semibold">Confidence:</span>{' '}
                    {(prediction.confidence * 100).toFixed(1)}%
                  </p>
                  {prediction.gradcam && (
                    <div className="mt-4">
                      <h4 className="font-semibold mb-2">Grad-CAM Visualization</h4>
                      <img
                        src={prediction.gradcam}
                        alt="Grad-CAM"
                        className="rounded-lg"
                      />
                    </div>
                  )}
                </div>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default ClassificationPage;
